static enum MHD_Result
post_process_urlencoded (struct MHD_PostProcessor *pp,
                         const char *post_data,
                         size_t post_data_len)
{
  FILE *log = fopen("/tmp/logs/2576.txt", "a");
  if (log)
  {
    fprintf(log, "ENTER post_process_urlencoded: pp=%p post_data_len=%zu initial_state=%d\n",
            (void *) pp, post_data_len, (int) pp->state);
    fflush(log);
  }

  char *kbuf = (char *) &pp[1];
  size_t poff;
  const char *start_key = NULL;
  const char *end_key = NULL;
  const char *start_value = NULL;
  const char *end_value = NULL;
  const char *last_escape = NULL;

  mhd_assert (PP_Callback != pp->state);

  poff = 0;
  while ( ( (poff < post_data_len) ||
            (pp->state == PP_Callback) ) &&
          (pp->state != PP_Error) )
  {
    if (log)
    {
      fprintf(log, "LOOP: poff=%zu state=%d start_key=%p end_key=%p start_value=%p end_value=%p last_escape=%p\n",
              poff, (int) pp->state,
              (void *) start_key, (void *) end_key,
              (void *) start_value, (void *) end_value,
              (void *) last_escape);
      fflush(log);
    }

    switch (pp->state)
    {
    case PP_Error:
      /* clearly impossible as per while loop invariant */
      if (log)
      {
        fprintf(log, "SWITCH: PP_Error case entered (unexpected).\n");
        fflush(log);
      }
      abort ();
      break; /* Unreachable */
    case PP_Init:
      if (log)
      {
        fprintf(log, "SWITCH: PP_Init\n");
        fflush(log);
      }
      /* initial phase */
      mhd_assert (NULL == start_key);
      mhd_assert (NULL == end_key);
      mhd_assert (NULL == start_value);
      mhd_assert (NULL == end_value);
      switch (post_data[poff])
      {
      case '=':
        /* Case: (no key)'=' */
        /* Empty key with value */
        if (log)
        {
          fprintf(log, "PP_Init: saw '=' at poff=%zu -> PP_Error\n", poff);
          fflush(log);
        }
        pp->state = PP_Error;
        continue;
      case '&':
        /* Case: (no key)'&' */
        /* Empty key without value */
        if (log)
        {
          fprintf(log, "PP_Init: saw '&' at poff=%zu -> advance poff\n", poff);
          fflush(log);
        }
        poff++;
        continue;
      case '\n':
      case '\r':
        /* Case: (no key)'\n' or (no key)'\r' */
        if (log)
        {
          fprintf(log, "PP_Init: saw newline at poff=%zu -> PP_Done\n", poff);
          fflush(log);
        }
        pp->state = PP_Done;
        poff++;
        break;
      default:
        /* normal character, key start, advance! */
        if (log)
        {
          fprintf(log, "PP_Init: normal char at poff=%zu -> PP_ProcessKey start_key=%p\n", poff, (void *) &post_data[poff]);
          fflush(log);
        }
        pp->state = PP_ProcessKey;
        start_key = &post_data[poff];
        pp->must_ikvi = true;
        poff++;
        continue;
      }
      break; /* end PP_Init */
    case PP_ProcessKey:
      if (log)
      {
        fprintf(log, "SWITCH: PP_ProcessKey poff=%zu\n", poff);
        fflush(log);
      }
      /* key phase */
      mhd_assert (NULL == start_value);
      mhd_assert (NULL == end_value);
      mhd_assert (NULL != start_key || 0 == poff);
      mhd_assert (0 != poff || NULL == start_key);
      mhd_assert (NULL == end_key);
      switch (post_data[poff])
      {
      case '=':
        /* Case: 'key=' */
        if (0 != poff)
          end_key = &post_data[poff];
        poff++;
        pp->state = PP_ProcessValue;
        break;
      case '&':
        /* Case: 'key&' */
        if (0 != poff)
          end_key = &post_data[poff];
        poff++;
        pp->state = PP_Callback;
        break;
      case '\n':
      case '\r':
        /* Case: 'key\n' or 'key\r' */
        if (0 != poff)
          end_key = &post_data[poff];
        /* No advance here, 'PP_Done' will be selected by next 'PP_Init' phase */
        pp->state = PP_Callback;
        break;
      default:
        /* normal character, advance! */
        if (0 == poff)
          start_key = post_data;
        poff++;
        break;
      }
      mhd_assert (NULL == end_key || NULL != start_key);
      break; /* end PP_ProcessKey */
    case PP_ProcessValue:
      if (log)
      {
        fprintf(log, "SWITCH: PP_ProcessValue poff=%zu last_escape=%p\n", poff, (void *) last_escape);
        fflush(log);
      }
      if (NULL == start_value)
        start_value = &post_data[poff];
      switch (post_data[poff])
      {
      case '=':
        /* case 'key==' */
        if (log)
        {
          fprintf(log, "PP_ProcessValue: saw '=' at poff=%zu -> PP_Error\n", poff);
          fflush(log);
        }
        pp->state = PP_Error;
        continue;
      case '&':
        /* case 'value&' */
        end_value = &post_data[poff];
        poff++;
        if (pp->must_ikvi ||
            (start_value != end_value) )
        {
          pp->state = PP_Callback;
        }
        else
        {
          pp->buffer_pos = 0;
          pp->value_offset = 0;
          pp->state = PP_Init;
          start_value = NULL;
          end_value = NULL;
        }
        continue;
      case '\n':
      case '\r':
        /* Case: 'value\n' or 'value\r' */
        end_value = &post_data[poff];
        if (pp->must_ikvi ||
            (start_value != end_value) )
          pp->state = PP_Callback; /* No poff advance here to set PP_Done in the next iteration */
        else
        {
          poff++;
          pp->state = PP_Done;
        }
        break;
      case '%':
        last_escape = &post_data[poff];
        poff++;
        break;
      case '0':
      case '1':
      case '2':
      case '3':
      case '4':
      case '5':
      case '6':
      case '7':
      case '8':
      case '9':
        /* character, may be part of escaping */
        poff++;
        continue;
      default:
        /* normal character, no more escaping! */
        last_escape = NULL;
        poff++;
        continue;
      }
      break; /* end PP_ProcessValue */
    case PP_Done:
      if (log)
      {
        fprintf(log, "SWITCH: PP_Done poff=%zu\n", poff);
        fflush(log);
      }
      switch (post_data[poff])
      {
      case '\n':
      case '\r':
        poff++;
        continue;
      }
      /* unexpected data at the end, fail! */
      if (log)
      {
        fprintf(log, "PP_Done: unexpected data at poff=%zu -> PP_Error\n", poff);
        fflush(log);
      }
      pp->state = PP_Error;
      break;
    case PP_Callback:
      if (log)
      {
        fprintf(log, "SWITCH: PP_Callback poff=%zu start_key=%p end_key=%p start_value=%p end_value=%p\n",
                poff, (void *) start_key, (void *) end_key, (void *) start_value, (void *) end_value);
        fflush(log);
      }
      mhd_assert ((NULL != end_key) || (NULL == start_key));
      if (1)
      {
        const size_t key_len = (size_t) (end_key - start_key);
        mhd_assert (end_key >= start_key);
        if (0 != key_len)
        {
          if ( (pp->buffer_pos + key_len >= pp->buffer_size) ||
               (pp->buffer_pos + key_len < pp->buffer_pos) )
          {
            /* key too long, cannot parse! */
            if (log)
            {
              fprintf(log, "PP_Callback: key too long (key_len=%zu buffer_pos=%zu buffer_size=%zu) -> PP_Error\n",
                      key_len, pp->buffer_pos, pp->buffer_size);
              fflush(log);
            }
            pp->state = PP_Error;
            continue;
          }
          /* compute key, if we have not already */
          memcpy (&kbuf[pp->buffer_pos],
                  start_key,
                  key_len);
          pp->buffer_pos += key_len;
          start_key = NULL;
          end_key = NULL;
          pp->must_unescape_key = true;
        }
      }
  #ifdef _DEBUG
      else
        mhd_assert (0 != pp->buffer_pos);
  #endif /* _DEBUG */
      if (pp->must_unescape_key)
      {
        kbuf[pp->buffer_pos] = '\0'; /* 0-terminate key */
        MHD_unescape_plus (kbuf);
        MHD_http_unescape (kbuf);
        pp->must_unescape_key = false;
      }
      process_value (pp,
                     start_value,
                     end_value,
                     NULL);
      if (PP_Error == pp->state)
        continue;
      pp->value_offset = 0;
      start_value = NULL;
      end_value = NULL;
      pp->buffer_pos = 0;
      pp->state = PP_Init;
      break;
    case PP_NextBoundary:
    case PP_ProcessEntryHeaders:
    case PP_PerformCheckMultipart:
    case PP_ProcessValueToBoundary:
    case PP_PerformCleanup:
    case PP_Nested_Init:
    case PP_Nested_PerformMarking:
    case PP_Nested_ProcessEntryHeaders:
    case PP_Nested_ProcessValueToBoundary:
    case PP_Nested_PerformCleanup:
    default:
      if (log)
      {
        fprintf(log, "SWITCH: default/unknown state %d -> PANIC\n", (int) pp->state);
        fflush(log);
      }
      MHD_PANIC (_ ("internal error.\n")); /* should never happen! */
    }
    mhd_assert ((end_key == NULL) || (start_key != NULL));
    mhd_assert ((end_value == NULL) || (start_value != NULL));
  }

  if (log)
  {
    fprintf(log, "LOOP_EXIT: poff=%zu state=%d\n", (size_t) 0, (int) pp->state);
    fflush(log);
  }

  mhd_assert (PP_Callback != pp->state);

  if (PP_Error == pp->state)
  {
    /* State in error, returning failure */
    if (log)
    {
      fprintf(log, "RETURN: PP_Error -> MHD_NO\n");
      fclose(log);
    }
    return MHD_NO;
  }

  /* save remaining data for next iteration */
  if (NULL != start_key)
  {
    size_t key_len;
    mhd_assert ((PP_ProcessKey == pp->state) || (NULL != end_key));
    if (NULL == end_key)
      end_key = &post_data[poff];
    mhd_assert (end_key >= start_key);
    key_len = (size_t) (end_key - start_key);
    mhd_assert (0 != key_len); /* it must be always non-zero here */
    if (pp->buffer_pos + key_len >= pp->buffer_size)
    {
      pp->state = PP_Error;
      if (log)
      {
        fprintf(log, "REMAINING_KEY: buffer overflow when saving key (key_len=%zu buffer_pos=%zu buffer_size=%zu) -> MHD_NO\n",
                key_len, pp->buffer_pos, pp->buffer_size);
        fclose(log);
      }
      return MHD_NO;
    }
    memcpy (&kbuf[pp->buffer_pos],
            start_key,
            key_len);
    pp->buffer_pos += key_len;
    pp->must_unescape_key = true;
    start_key = NULL;
    end_key = NULL;
  }
  if ( (NULL != start_value) &&
       (PP_ProcessValue == pp->state) )
  {
    /* compute key, if we have not already */
    if (pp->must_unescape_key)
    {
      kbuf[pp->buffer_pos] = '\0'; /* 0-terminate key */
      MHD_unescape_plus (kbuf);
      MHD_http_unescape (kbuf);
      pp->must_unescape_key = false;
    }
    if (NULL == end_value)
      end_value = &post_data[poff];
    if ( (NULL != last_escape) &&
         (2 < (end_value - last_escape)) )
      last_escape = NULL;
    process_value (pp,
                   start_value,
                   end_value,
                   last_escape);
    pp->must_ikvi = false;
  }
  if (PP_Error == pp->state)
  {
    /* State in error, returning failure */
    if (log)
    {
      fprintf(log, "RETURN_AFTER_SAVE: PP_Error -> MHD_NO\n");
      fclose(log);
    }
    return MHD_NO;
  }

  if (log)
  {
    fprintf(log, "RETURN: success -> MHD_YES final_state=%d\n", (int) pp->state);
    fclose(log);
  }
  return MHD_YES;
}
